import React from 'react';
import './App.css';
import {
Figure
}from "reactstrap"; 

function App() {
  return (
    <Figure>
    <Figure.Image
      width={171}
      height={180}
      alt="171x180"
      src="logo512.png"
    />
    <Figure.Caption>
      Nulla vitae elit libero, a pharetra augue mollis interdum.
    </Figure.Caption>
  </Figure>
  );
}

export default App;
